import React from "react";

const Game = () => {
  return (
    <>
      <div className="bg-emerald-300 h-[85vh] flex justify-center items-center">
        <div className="bg-emerald-500 h-[45vh] w-[50%] rounded-md shadow-lg shadow-slate-600/50 flex flex-col justify-center items-center gap-6">
            <h3 className="text-xl font-bold"> Guess the Word:  </h3>
            <input className="bg-slate-300 h-12 rounded-3xl outline-0"></input>
            <button className="bg-white h-12 w-20 text-base font-medium text-red-600"> GUESS </button>
        </div>
      </div>
    </>
  );
};

export default Game;
